import '../assets/toDoList.css'
import { jwtDecode } from 'jwt-decode'
import { useEffect, useState } from 'react'
import addIcon from '../assets/add_icon.svg'
import checkIcon from '../assets/check.svg'

const checkItems = ['option 1', 'option 2',];

function ToDoList(){
    const dates = jwtDecode(localStorage.getItem('token'));
    const code = dates.institution;
    const user = dates.user;
    const [checkItemsState, setCheckItemsState] = useState([]);
    const [listData, setListData] = useState([]);
    useEffect(() => {
        setCheckItemsState(new Array(checkItems.length).fill(false));
    }, [checkItems]);
    useEffect(() => {
        const requestList = async () => {
            try{
                const response = await fetch('http://localhost:5000/addtask', {
                    method: 'POST',
                    headers: {
                        'content-type' : 'application/json',
                    },
                    body: JSON.stringify({
                        code: code,
                        user: user,
                    })
                });
                if(response.status === 200){
                    const list = await response.json();
                    console.log(list);
                    setListData(list);
                }
            }
            catch(error){
                console.log('usuario invalido');
            }
        };
        requestList();
    }, [code]);
    return(
        <div className='Main-container-list'>
            <div className='List-container'>
                <div className='List-item'>
                    <div key={0} className='Check-div' onClick={() => {
                        const newCheck = [... checkItemsState];
                        newCheck[0] = !checkItemsState[0];
                        setCheckItemsState(newCheck);
                    }}>
                        <div className={`Circle-check${checkItemsState[0] ? 'ed' : ' '}`}>
                            <img className={`img-check${checkItemsState[0] ? 'ed' : ' '}`} src={checkIcon}></img>
                        </div>
                    </div>
                    <div className='Info-task-container'>
                        <span className='Date-span'>21-08-2025</span>
                        <h4 className='Title-task'>End to-do list</h4>
                    </div>
                    <div className='State-container'>
                        <span className='State-span'>En progreso</span>
                        <div className='Circle-state'></div>
                    </div>
                </div>
                <div className='List-item'>
                    <div key={0} className='Check-div' onClick={() => {
                        const newCheck = [... checkItemsState];
                        newCheck[0] = !checkItemsState[0];
                        setCheckItemsState(newCheck);
                    }}>
                        <div className={`Circle-check${checkItemsState[0] ? 'ed' : ' '}`}>
                            <img className={`img-check${checkItemsState[0] ? 'ed' : ' '}`} src={checkIcon}></img>
                        </div>
                    </div>
                    <div className='Info-task-container'>
                        <span className='Date-span'>21-08-2025</span>
                        <h4 className='Title-task'>End to-do list</h4>
                    </div>
                    <div className='State-container'>
                        <span className='State-span'>En progreso</span>
                        <div className='Circle-state'></div>
                    </div>
                </div>
                <div className='List-item'>
                    <div key={0} className='Check-div' onClick={() => {
                        const newCheck = [... checkItemsState];
                        newCheck[0] = !checkItemsState[0];
                        setCheckItemsState(newCheck);
                    }}>
                        <div className={`Circle-check${checkItemsState[0] ? 'ed' : ' '}`}>
                            <img className={`img-check${checkItemsState[0] ? 'ed' : ' '}`} src={checkIcon}></img>
                        </div>
                    </div>
                    <div className='Info-task-container'>
                        <span className='Date-span'>21-08-2025</span>
                        <h4 className='Title-task'>End to-do list</h4>
                    </div>
                    <div className='State-container'>
                        <span className='State-span'>En progreso</span>
                        <div className='Circle-state'></div>
                    </div>
                </div>
                <div className='List-item'>
                    <div key={0} className='Check-div' onClick={() => {
                        const newCheck = [... checkItemsState];
                        newCheck[0] = !checkItemsState[0];
                        setCheckItemsState(newCheck);
                    }}>
                        <div className={`Circle-check${checkItemsState[0] ? 'ed' : ' '}`}>
                            <img className={`img-check${checkItemsState[0] ? 'ed' : ' '}`} src={checkIcon}></img>
                        </div>
                    </div>
                    <div className='Info-task-container'>
                        <span className='Date-span'>21-08-2025</span>
                        <h4 className='Title-task'>End to-do list</h4>
                    </div>
                    <div className='State-container'>
                        <span className='State-span'>En progreso</span>
                        <div className='Circle-state'></div>
                    </div>
                </div>
            </div>
            <div className='Info-container'>
                <div className='Button-container'>
                    <button className='Button-add'><img className='Add-icon' src={addIcon}></img></button>
                </div>
            </div>
        </div>
    );
}
export default ToDoList;
